import React from 'react'

function Tracks({response}) {
    
    let topten = [];

    if(response !== null){
        for(let i=0 ; i<10 ; i++){
            topten.push(response.data.data[i]);
        }

        topten.forEach(function(item,index){
            console.log(item,index);
            let songname = item.title_short;
            console.log(songname,item.album.id);
        });
    }
/*
    const showtop = () => {
            topten.map(item=>{
                return (<h1 key={item.album.id}></h1>)
            });
    }
*/

const showall = ()=>{
    topten.map(item => {
        return (
            <h1 key={item.album.id}>
                {item.title_short}
            </h1>
        );
    })();
}

let thelist = (<showall/>);



return (
    <div>
        {thelist}
    </div>
)




}

export default Tracks
